import React from 'react';
import logo from './resources/logo.PNG';
import './App.css';
import TopButtons from "/components/Top-Buttons.js"

function App() {
    return ( 
      <div className="App" >
        <Top-Buttons></Top-Buttons>
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo"/>
        </header > 
      </div>
    );
}
export default App;
